import React from 'react';
import { IonContent, IonHeader, IonPage, IonTitle, IonToolbar, IonButton } from '@ionic/react';

const App = () => (
  <IonPage>
    <IonHeader>
      <IonToolbar>
        <IonTitle>Teste</IonTitle>
      </IonToolbar>
    </IonHeader>
  </IonPage>
);

export default App;
